import{_ as e,c as n,o as s,f as a,D as l}from"./chunks/framework.BG74BkEs.js";const _=JSON.parse('{"title":"技术支持","description":"","frontmatter":{},"headers":[],"relativePath":"zh/support/index.md","filePath":"zh/support/index.md","lastUpdated":1706881550000}'),t={name:"zh/support/index.md"},r=a('<h1 id="技术支持" tabindex="-1">技术支持 <a class="header-anchor vp-link" href="#技术支持" aria-label="Permalink to &quot;技术支持&quot;">​</a></h1><p>如果有任何关于引擎的问题，请确保先阅读了<a href="/naninovel-docs/zh/guide/" class="vp-link">开始引导</a> 和 <a href="/naninovel-docs/zh/api/" class="vp-link">API命令参考</a> 中你遇到问题的相应部分；也可以查阅<a href="/naninovel-docs/zh/faq/" class="vp-link">常见问题</a> ，了解常见问题。</p><p>如果你确定你遇到的问题没有相关描述，检查是否使用最新版本资源。使用Unity内的<a href="https://docs.unity3d.com/Manual/AssetStore.html" class="vp-link" target="_blank" rel="noreferrer">Asset Store window<span class="external-link-icon"> ↗</span></a> 来更新。使用相关扩展资源时，下载导入最新的扩展支持包：</p><ul><li><a href="https://github.com/naninovel/samples/raw/main/unity/live2d/NaninovelLive2D.unitypackage" class="vp-link" target="_blank" rel="noreferrer">Naninovel Live2D角色使用<span class="external-link-icon"> ↗</span></a></li><li><a href="https://github.com/Naninovel/PlayMaker/raw/master/NaninovelPlayMaker.unitypackage" class="vp-link" target="_blank" rel="noreferrer">Naninovel PlayMaker使用<span class="external-link-icon"> ↗</span></a></li><li><a href="https://github.com/Naninovel/AdventureCreator/raw/master/NaninovelAdventureCreator.unitypackage" class="vp-link" target="_blank" rel="noreferrer">Naninovel AdventureCreator使用<span class="external-link-icon"> ↗</span></a></li></ul><p>如果更新后依旧有问题，试着删除<code>Naninovel</code> 目录后，重新安装资源包。确保更新时严格按照<a href="https://github.com/Naninovel/Documentation/releases" class="vp-link" target="_blank" rel="noreferrer">更新说明<span class="external-link-icon"> ↗</span></a> 执行操作。</p><h2 id="问题追踪" tabindex="-1">问题追踪 <a class="header-anchor vp-link" href="#问题追踪" aria-label="Permalink to &quot;问题追踪&quot;">​</a></h2><p>如果上述没有任何作用，查阅<a href="https://github.com/Naninovel/Documentation/issues?q=is%3Aissue+label%3Abug" class="vp-link" target="_blank" rel="noreferrer">问题追踪<span class="external-link-icon"> ↗</span></a> — 也许是已经解决过的问题。</p><h2 id="社区论坛" tabindex="-1">社区论坛 <a class="header-anchor vp-link" href="#社区论坛" aria-label="Permalink to &quot;社区论坛&quot;">​</a></h2><p>考虑加入专门的<a href="https://forum.naninovel.com" class="vp-link" target="_blank" rel="noreferrer">Naninovel论坛<span class="external-link-icon"> ↗</span></a> ，这里所有本资源用户都会互相解决开发问题，分析经验和演示项目。你遇到的问题可能已经有其他人解决了；你可以随时求助，如果该问题没有解决。</p><h2 id="unity支持" tabindex="-1">Unity支持 <a class="header-anchor vp-link" href="#unity支持" aria-label="Permalink to &quot;Unity支持&quot;">​</a></h2><p>即使我们提供了多个视频教程和示例项目来演示如何使用unity达到Naninovel的特性效果，但是我们不会提供任何关于unity的内置工具的使用说明和帮助支持。</p><p>untiy是个人电脑产品，拥有众多特性；它有自己的说明文档，支持服务，和社区讨论，涵盖了相当丰富的Unity学习材料。你可以在其中轻松找到任何你想要的视频教程，指引或是有的问题。如果真的没有找到想要的答案，你可以在 <a href="https://forum.unity.com" class="vp-link" target="_blank" rel="noreferrer">Unity 论坛<span class="external-link-icon"> ↗</span></a> 或 <a href="https://answers.unity.com/questions/ask.html" class="vp-link" target="_blank" rel="noreferrer">Q&amp;A服务<span class="external-link-icon"> ↗</span></a> 提问，或使用任何官方<a href="https://unity.com/support-services" class="vp-link" target="_blank" rel="noreferrer">求助选项<span class="external-link-icon"> ↗</span></a></p><h2 id="开发支持developer-support" tabindex="-1">开发支持Developer Support <a class="header-anchor vp-link" href="#开发支持developer-support" aria-label="Permalink to &quot;开发支持Developer Support&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>开发支持仅用于英语和俄语讨论Naninovel相关的话题。其他关于Unity（uGUI，寻址系统，C#代码）的任何问题参考<a href="/naninovel-docs/zh/support/#unity支持" class="vp-link">Unity支持</a>。</p></div><p>要获得直接开发支持，加入Discord服务器<a href="https://discord.gg/BfkNqem" class="vp-link" target="_blank" rel="noreferrer">discord.gg/BfkNqem<span class="external-link-icon"> ↗</span></a>) 然后注册你的资源副本到注册论坛<a href="https://naninovel.com/register/" class="vp-link" target="_blank" rel="noreferrer">naninovel.com/register<span class="external-link-icon"> ↗</span></a> 。注册完成后，你会自动变成 &quot;Verified User&quot;（认证用户），并开通 <code>#support</code> 渠道.</p>',15),i=l("iframe",{src:"https://discordapp.com/widget?id=545676116871086080&theme=dark",width:"100%",height:"500",allowtransparency:"true",frameborder:"0"},null,-1),o=a(`<p>注意，<strong>开发反馈可能延迟24H以上</strong> （部分情况更长），所以确保：</p><ul><li>提供清晰简明的问题描述，并一步一步说明如何再现问题。</li><li>明确使用的Naninovel和unity版本，目标平台（Android，iOS，WebGL，等），电脑操作系统（Windows，Mac 或 Linux）。</li><li>附加上包含该描述问题的错误或警告的<a href="https://docs.unity3d.com/Manual/LogFiles.html" class="vp-link" target="_blank" rel="noreferrer">log文件<span class="external-link-icon"> ↗</span></a> 。</li></ul><p>附加上<a href="/naninovel-docs/zh/support/#复制项目" class="vp-link">复制项目</a> 会大大提高并尽快识别修复该问题的可能。</p><h2 id="复制项目" tabindex="-1">复制项目 <a class="header-anchor vp-link" href="#复制项目" aria-label="Permalink to &quot;复制项目&quot;">​</a></h2><p>报告问题是，我们可能会要求复制项目，复制项目是用于再现问题的仅包含基础相关资源和设置的<strong>极小化</strong>的新项目。</p><p>跟随以下步骤来创建分享复制项目：</p><ol><li>创建新Unity项目，确保使用的Unity版本能被支持，参考<a href="https://github.com/Naninovel/Documentation/releases" class="vp-link" target="_blank" rel="noreferrer">当前Naninovel支持<span class="external-link-icon"> ↗</span></a> 。</li><li>导入最新Naninovel包（或是导入之前可用版本的包）。</li><li>添加重现问题需要的设置和资源。<strong>确保Naninovel脚本足够短小</strong>以及资源为<strong>重现问题必需的</strong>。</li><li>创建文本文件（.txt），使用英语一步一步记述如何再现该问题。如下：</li></ol><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span>1. Open scene &quot;SampleScene&quot;.</span></span>
<span class="line"><span>2. Enter play mode in the editor.</span></span>
<span class="line"><span>3. Start a new game.</span></span>
<span class="line"><span>4. Play through to the line number 15.</span></span>
<span class="line"><span>5. Save and load the game.</span></span></code></pre></div><p>然后添加上你想要达到的效果，和实际运行产生的效果，比如：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span>Expected: Music &quot;Ambient&quot; should start playing.</span></span>
<span class="line"><span>Actual: No music is playing.</span></span></code></pre></div><ol start="5"><li>关闭Unity编辑器，除了创建的文本文件，及 <code>Assets</code>，<code>Packages</code> 和 <code>ProjectSettings</code> 目录外，移除所有其他目录。最主要的是 <strong>确保删除了 <code>Library</code> 目录</strong>，因为其中包含了很多自动生成的文件，会显著增大包大小。</li><li>将项目压缩为zip，上传至Google Drive或是在Discord附件私信。</li></ol><p>记得进通过私信来提交你都项目，<strong>千万不要在公共频道发出</strong>，以避免个人数据或者版权资源的泄露。</p>`,12),p=[r,i,o];function c(h,d,u,k,v,g){return s(),n("div",null,p)}const f=e(t,[["render",c]]);export{_ as __pageData,f as default};
